import React from 'react';
import './DummyProgress.scss';

class DummyProgress extends React.Component {
    constructor(props){
        super(props)
        this.state= {
            count:0
        }
    }
    render(){
        return(
            <div>
                <div>
                    <div>
                        <p>{this.state.count}</p>
                    </div>
                </div>
            </div>
        )
    }
}

export default DummyProgress;
